def find_duplicates(arr):
    count = {}
    for num in arr:
        count[num] = count.get(num, 0) + 1
    duplicates = []
    for num in count:
        if count[num] > 1:
            duplicates.append(num)
    duplicates.sort()
    if len(duplicates) != 0:
        return 'No duplicates found.'
    else:
        return duplicates

